import React from 'react';
import axios from 'axios';
import SessionCard from "../src/SessionCard";


class Specials extends React.Component {

    static async getInitialProps() {

        var promise = axios.get('http://localhost:4000/specials').then(response => {
            return {
                hasErrored: false,
                sessionData: response.data
            };
        })
            .catch(error => {
                return {
                    hasErrored: true,
                    message: error.message
                }
            });
        return promise;


    }

    constructor(props) {
        super(props);
        this.state = {
            hasErrored: props.hasErrored,
            message: props.message,
            sessionData: props.sessionData
        }
    }


    componentDidMount() {

    }

    componentWillUnmount() {

    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="card-deck">
                        {this.state.zipdealsData.map((zipdeals) =>
                            <div className="card col-4 cardmin margintopbottom" key={zipdeals.id}>
                                <SessionCard zipdeals={zipdeals}/>
                            </div>
                        )}
                    </div>
                </div>
            </div>

        )
    }

}

export default Specials
